import { Select, SelectContent, SelectItem, SelectTrigger, SelectValue } from "./ui/select";

export function FilterBar({ onCuisineChange, onRatingChange, onLocationChange }) {
  return (
    <div className="space-y-4">
      <h2 className="text-black">RESTAURANT LISTING</h2>
      
      <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
        <Select onValueChange={onCuisineChange}>
          <SelectTrigger className="bg-[#c9a8bd] border-none text-black">
            <SelectValue placeholder="CUISINE" />
          </SelectTrigger>
          <SelectContent>
            <SelectItem value="all">All Cuisines</SelectItem>
            <SelectItem value="fried-chicken">Fried Chicken</SelectItem>
            <SelectItem value="burgers">Burgers</SelectItem>
            <SelectItem value="coffee">Coffee & Beverages</SelectItem>
            <SelectItem value="fast-food">Fast Food</SelectItem>
          </SelectContent>
        </Select>

        <Select onValueChange={onRatingChange}>
          <SelectTrigger className="bg-[#c9a8bd] border-none text-black">
            <SelectValue placeholder="RATINGS" />
          </SelectTrigger>
          <SelectContent>
            <SelectItem value="all">All Ratings</SelectItem>
            <SelectItem value="4+">4+ Stars</SelectItem>
            <SelectItem value="3+">3+ Stars</SelectItem>
            <SelectItem value="2+">2+ Stars</SelectItem>
          </SelectContent>
        </Select>

        <Select onValueChange={onLocationChange}>
          <SelectTrigger className="bg-[#c9a8bd] border-none text-black">
            <SelectValue placeholder="LOCATIONS" />
          </SelectTrigger>
          <SelectContent>
            <SelectItem value="all">All Locations</SelectItem>
            <SelectItem value="downtown">Downtown</SelectItem>
            <SelectItem value="midtown">Midtown</SelectItem>
            <SelectItem value="uptown">Uptown</SelectItem>
            <SelectItem value="suburbs">Suburbs</SelectItem>
          </SelectContent>
        </Select>
      </div>
    </div>
  );}
